----------------------------------------------------------------------------

function GetMapScriptInfo()
	return {
		Name = "A Grande New World",
		Description = [[A map script designed to generate realistic terrain using Gplate plate tectonics. WARNING! Is one use only due to RAM swap size issues!]],
		SupportsSinglePlayer = true,
		SupportsMultiplayer = true,
		IsAdvancedMap = true,		
}
end

function GetMapInitData(worldSize)
	return {
		Width = 128,
		Height = 69,
		WrapX = true,
		WrapY = false,
	};      
end
