------------------------------------------------------------------------------
nORbConvWorld = {};

function nORbConvWorld.Create()
	print("Create nORbConvWorld class.");
	local gridWidth, gridHeight = Map.GetGridSize();
	
	local data = {
		GeneratePlotTypes     = nORbConvWorld.GeneratePlotTypes,
		GenerateTerrainAtPlot = nORbConvWorld.GenerateTerrainAtPlot,
		GenerateTerrain       = nORbConvWorld.GenerateTerrain,
		FillPlots             = nORbConvWorld.FillPlots,
		FillTerrains          = nORbConvWorld.FillTerrains,
		FillRivers            = nORbConvWorld.FillRivers,
		FillFeatures          = nORbConvWorld.FillFeatures,
		FillResources         = nORbConvWorld.FillResources,
		FillImprovements      = nORbConvWorld.FillImprovements,
		FillRegions           = nORbConvWorld.FillRegions,
		FillStartingPlots     = nORbConvWorld.FillStartingPlots,
		PlaceNaturalWonders   = nORbConvWorld.PlaceNaturalWonders,
		IsPlot4StartCiv       = nORbConvWorld.IsPlot4StartCiv,
		SetBlockedPlotsByCiv  = nORbConvWorld.SetBlockedPlotsByCiv,
		GetCivStartPlot       = nORbConvWorld.GetCivStartPlot,
		GetMinorCivStartPlot  = nORbConvWorld.GetMinorCivStartPlot,
		MoveStartPos          = nORbConvWorld.MoveStartPos,
		iNumPlotsX = gridWidth,
		iNumPlotsY = gridHeight,
		isWrapX = Map.IsWrapX(),
		isWrapY = Map.IsWrapY(),
		arBlockedPlotsByCiv = {},
	};
	return data;

end
------------------------------------------------------------------------------
function nORbConvWorld:GeneratePlotTypes()
	print("Generate Plot Types.");	
	local plotTypes = table.fill(PlotTypes.PLOT_LAND, self.iNumPlotsX * self.iNumPlotsY);
	return plotTypes;
end
----------------------------------------------------------------------------------
function nORbConvWorld:GenerateTerrain()		
	print("Generate Terrain.");
	local terrainData = {}
	local i = 0;
	for indY = 0, self.iNumPlotsY - 1 do
		for indX = 0, self.iNumPlotsX - 1 do
			terrainData[i] = TerrainTypes.TERRAIN_GRASS;
			i = i + 1;
		end
	end
	return terrainData;
end
