function nORbConvWorld:PlaceNaturalWonders()
	print("Placing Natural Wonders.");
	local wonder_list = table.fill(0, 16);
	for thisFeature in GameInfo.Features() do
		if thisFeature.Type == "FEATURE_CRATER" then
			wonder_list[0] = thisFeature.ID;
		elseif thisFeature.Type == "FEATURE_FUJI" then
			wonder_list[1] = thisFeature.ID;
		elseif thisFeature.Type == "FEATURE_MESA" then
			wonder_list[2] = thisFeature.ID;
		elseif thisFeature.Type == "FEATURE_REEF" then
			wonder_list[3] = thisFeature.ID;
		elseif thisFeature.Type == "FEATURE_VOLCANO" then
			wonder_list[4] = thisFeature.ID;
		elseif thisFeature.Type == "FEATURE_GIBRALTAR" then
			wonder_list[5] = thisFeature.ID;
		elseif thisFeature.Type == "FEATURE_GEYSER" then
			wonder_list[6] = thisFeature.ID;
		elseif thisFeature.Type == "FEATURE_FOUNTAIN_YOUTH" then
			wonder_list[7] = thisFeature.ID;
		elseif thisFeature.Type == "FEATURE_POTOSI" then
			wonder_list[8] = thisFeature.ID;
		elseif thisFeature.Type == "FEATURE_EL_DORADO" then
			wonder_list[9] = thisFeature.ID;
		elseif thisFeature.Type == "FEATURE_SRI_PADA" then
			wonder_list[10] = thisFeature.ID;
		elseif thisFeature.Type == "FEATURE_MT_SINAI" then
			wonder_list[11] = thisFeature.ID;
		elseif thisFeature.Type == "FEATURE_MT_KAILASH" then
			wonder_list[12] = thisFeature.ID;
		elseif thisFeature.Type == "FEATURE_ULURU" then
			wonder_list[13] = thisFeature.ID;
		elseif thisFeature.Type == "FEATURE_LAKE_VICTORIA" then
			wonder_list[14] = thisFeature.ID;
		elseif thisFeature.Type == "FEATURE_KILIMANJARO" then
			wonder_list[15] = thisFeature.ID;
		elseif thisFeature.Type == "FEATURE_SOLOMONS_MINES" then
			wonder_list[16] = thisFeature.ID;
		end
	end
		
	local arNaturalWonders = {{10, 14, 21},{93, 15, 10},{93, 16, 10},{92, 17, 10},{114, 21, 9},{97, 22, 20},{66, 23, 7},{66, 31, 15},{49, 35, 11},{20, 40, 13},
